
var longestDupSubstring = function(s) {
    const n=s.length
    function check_m(m){
      console.log(m)
      const h=new Set()
      for (let i=0;i+m<=n;i++){
          const sub=s.substring(i,i+m)
          //console.log(m,i,sub)
          if (h.has(sub)){
              return sub
          }
          h.add(sub)
      }
      return null
    }
    function search(low,high){
      if (high==low)
        return check_m(high)
      const mid=Math.ceil((high+low)/2)
      const mid_val=check_m(mid)
      if (mid_val!=null)
        return search(mid,high)
      return search(low,mid-1)
    }
    return search(0,n-1)
};
